import React, { useState } from 'react';
import axios from 'axios';



export function LogIn() {
    const [formData, setFormData] = useState({
        email: "",
        password: ""   
    });

    const handleSubmit = (e) => {
        e.preventDefault()
        console.log(formData)

        axios.post('https://127.0.0.1:4000/login', formData, {withCredentials: true})
            .then(res => console.log(res.data))
            .catch( err=> {console.log('Log In Error: ' + err);});

    }
    

    return(
        <div style={{paddingLeft: '80px', paddingRight: '100px'}}>
        <h3 > Log In </h3>
        <form onSubmit={handleSubmit} >
            <div className="form-group">
                <label htmlFor="email">Email</label>
                <input type='email' className="form-control" value={formData.email} placeholder="Enter Email"
                onChange={(e)=>{setFormData({...formData, email: e.target.value})}}/>
            </div>
            <div className="form-group">
                <label htmlFor="password">Password</label>
                <input type='password' size='50' className="form-control" value={formData.password} placeholder="Password" 
                onChange={(e)=>{setFormData({...formData, password: e.target.value})}}/> 
            </div>
            <button type="submit" className="btn btn-primary" style={{marginTop: '10px', marginLeft: '10px'}}>Submit</button>
            <div style={{paddingBottom: '50px' }}></div>
        </form>
        </div>
    );
}
